import React from 'react';

const Flag = ({name,flag,population,region,capital}) => {
    return (
        <div className='Flag'>
            <img src={flag}></img>
            <h2>{name}</h2>
            <div>{`Population: ${population}`}</div>
            <div>{`Region: ${region}`}</div> 
            <div>{`Capital:${capital}`}</div>

        </div>
    )
}

export default Flag;
